import styled from 'styled-components'

export const BannerWrapper = styled.div`
    display: grid;
    grid-template-columns: repeat(5, 1fr);
    grid-template-rows: repeat(2, 1fr);
    padding: 2rem 5rem;
    border-bottom: 2px solid #888;
`
